import React from 'react';

const Services = () => (
  <section id="services">
    <h2>Our Services</h2>
    <ul>
      <li><strong>Hosting:</strong> Fast and reliable game servers.</li>
      <li><strong>Tournaments:</strong> Regular competitions.</li>
      <li><strong>Game Development:</strong> Custom game design.</li>
      <li><strong>Player Support:</strong> 24/7 assistance.</li>
    </ul>
  </section>
);

export default Services;
